webpackJsonp([0xee0d84fcd1f],{642:function(e,A){e.exports={data:{profile:{id:"8daf2a19-34de-5fd2-9149-f09dcaccde28",content:"<div>Corey Mitchell, a.k.a. &#8220;Mr. Bajan&#8221;, was born and raised in Barbados, West Indies. He began spinning in clubs and at concerts with Natural Mystic Soundsation of Orlando, Florida in the early 90s. A strong partnership developed and in 1999, Mr. Bajan left the group to expand the mystic sound to Boston. He now has over 15 years of experience in the music industry and performs as the DJ/Master of Ceremonies for various events in the Boston area, including weddings, private parties, themed events &amp; fundraisers.</div>\n<div></div>\n<div>With his Associates Degree in Radio Broadcasting from the New England Institute of Art and Technology, Corey has achieved a lot of broadcasting experience on 93.7 MIKE FM, WAAF, WRKO, WEEI, WJMN 94,5, KISS 108 &amp; WPVO BOSTON Internet Radio. Corey has also performed in many retail &amp; public settings such as METRO PCS, SEPHORA, STILA, DIOR, M.I.T., LIFE IS GOOD.BICYCLES BATTLING CANCER and countless club events. If you&#8217;re seeking a tenured DJ who is the consummate pro, line up a time to chat with Corey today.</div>\n",title:"Corey Mitchell",acf:{title:"DJ / Emcee",video:"https://youtu.be/HEJDPJApMYw",facebook:"",instagram:"",testimonials:'<div class="content-block content-block-testimonial "><p><br />\nWe cannot emphasize enough how grateful we are for C-Zone, specifically for our wedding DJ, Corey Mitchell. We&#8217;ve had friends and family express some frustrations after their own weddings with the DJs they had hired, but every preliminary phone call with Corey put our minds at ease and made us feel like we were in good hands. Corey was always warm, gracious, and open to all of our requests for how we wanted music integrated into our wedding. He delivered in a huge way. He used our playlists in a way that kept the dance party alive, using his own expertise to blend with our (sometimes very niche) music selections. Corey was supremely professional, and we would hire him again in a heartbeat.<br />\n</p><p class="from">Carlee and Bobby, Olio, 8.2.25</p></div>\n<div class="content-block content-block-testimonial "><p><br />\nMany guests said &#8220;best wedding dance floor we&#8217;ve been on&#8221;. C-Zone was collaborative, easy to work with and DJ Corey Mitchell was 10/10. Thank you!<br />\n</p><p class="from">Jake and Jimmy, Mission Boathouse, 9.20.25</p></div>\n<div class="content-block content-block-testimonial "><p><br />\nWe hired C-Zone for our wedding and we could not be happier with our decision. The whole process was super smooth and Gina was very easy to communicate with over email. DJ Corey was great and kept the dance floor packed the whole night! The photo booth was run so well and the quality of the pictures was excellent. Definitely don&#8217;t hesitate to book with C-Zone for your wedding (or any other event!)<br />\n</p><p class="from">Samantha and Alec, Connemara House Farm, 9.13.25</p></div>\n'},image:{localFile:{childImageSharp:{thumbnail:{base64:"data:image/jpeg;base64,",aspectRatio:.9666666666666667,src:"/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-d0643.jpg",srcSet:"/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-2c2fe.jpg 110w,\n/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-a2e2b.jpg 220w,\n/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-d0643.jpg 440w,\n/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-77eb3.jpg 660w,\n/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-78eca.jpg 880w,\n/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-d928a.jpg 1160w",sizes:"(max-width: 440px) 100vw, 440px",originalImg:"/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-d928a.jpg"},full:{src:"/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-10d9a.jpg",height:414,width:400,srcSet:"/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-10d9a.jpg 1x,\n/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-738fa.jpg 1.5x,\n/static/58d45de0c866f4d5760e4e6caffbda8d-c538e0d152ea4b928470f17dcd6b13cf-4042a.jpg 2x"}}}},yoast:{title:"",canonical:"",metaDescription:"",linkdex:"",metakeywords:"",noIndex:"",noFollow:"",meta_robots_adv:"",metaKeywords:"",redirect:"",ogTitle:"",ogDescription:"",ogImage:"",twitterTitle:"",twitterDescription:"",twitterImage:""}},site:{id:"Site",siteMeta:{title:"C-Zone Entertainment",subtitle:"Premiere DJs & Musicians | Servicing Greater Boston & New England | 617.320.0723"}}},pathContext:{id:"8daf2a19-34de-5fd2-9149-f09dcaccde28"}}}});
